function support_init(){$(document).find("#form_support").on("submit",function(){return $.ajax({url:"/app/app.php",method:"POST",data:$(this).serialize()+"&form_support=form_support&app=app",xhrFields:{withCredentials:!1}}).done(function(p){$(document).find("#form_support").html("Сообщение успешно отправленно")}),!1})}